DELIMITER $$
--
-- Procedures
--
CREATE  PROCEDURE `add_epc_rec` (IN `var_Retail_CycleCountID` VARCHAR(255), IN `var_store_id` VARCHAR(255), IN `var_epc` VARCHAR(255), IN `var_item_code` VARCHAR(255), IN `var_department` VARCHAR(255), IN `var_brand` VARCHAR(255), IN `var_color` VARCHAR(255), IN `var_size` VARCHAR(255), IN `var_date_time` VARCHAR(255))  BEGIN
SELECT * FROM 
        (
            SELECT var_Retail_CycleCountID,var_store_id,var_epc,var_item_code,var_department,var_brand,var_color,var_size,var_date_time
        ) AS tmp  
        WHERE NOT EXISTS (
            SELECT epc FROM epc  WHERE epc = var_epc  
        ) LIMIT 1; 
END$$

CREATE  PROCEDURE `product_item_master_itemss` (IN `var_store_id` VARCHAR(255), IN `var_sku` VARCHAR(255), IN `var_product_name` VARCHAR(255), IN `var_product_des` VARCHAR(255), IN `var_epc` VARCHAR(255), IN `var_last_detected_time` VARCHAR(255), IN `var_user` VARCHAR(255), IN `var_zone` VARCHAR(255), IN `var_department_id` VARCHAR(255), IN `var_brand` VARCHAR(255), IN `var_color` VARCHAR(255), IN `var_size` VARCHAR(255), IN `var_sfsr` VARCHAR(255), IN `var_status` VARCHAR(255), IN `var_group_name` VARCHAR(255), IN `var_group_description` VARCHAR(255), IN `var_dept` VARCHAR(255), IN `var_departmentname` VARCHAR(255), IN `var_brand_description` VARCHAR(255), IN `var_barcode` VARCHAR(255), IN `var_model` VARCHAR(255), IN `var_subgroup` VARCHAR(255), IN `var_sgroup` VARCHAR(255))  BEGIN
   
        DECLARE my_sku DECIMAL(10,2) DEFAULT 0;
        
        SELECT skucode 
        INTO my_sku
        FROM product_item_master
        WHERE `skucode` = var_sku;

